  return (
    <div className="min-h-screen bg-gradient-to-b from-indigo-50 to-white">
      <Navbar />
      <main className="flex flex-col items-center px-6 py-16 md:py-24">
        <div className="bg-white rounded-3xl p-8 shadow-xl max-w-5xl w-full text-black">
          <h2 className="text-4xl font-extrabold mb-8 text-center text-indigo-700 tracking-wide">
            Caută un zbor
          </h2>
          <FlightSearch onSearch={handleSearch} />
        </div>
      </main>
    </div>
  );
};

